Sharen = {
    vkontakte: function (purl, ptitle, pimg, text) {
        url = 'http://vkontakte.ru/share.php?';
        url += 'url=' + encodeURIComponent(purl);
        url += '&title=' + encodeURIComponent(ptitle);
        url += '&image=' + encodeURIComponent(pimg);
        url += '&noparse=true';
        Share.popup(url);
    },
    odnoklassniki: function (purl, ptitle, pimg, text) {
        url = 'http://www.odnoklassniki.ru/dk?st.cmd=addShare&st.s=1';
        url += '&st.comments=' + encodeURIComponent(text);
        url += '&st._surl=' + encodeURIComponent(purl);
        Share.popup(url);
    },
    facebook: function (purl, ptitle, pimg, text) {
        url = 'https://www.facebook.com/sharer/sharer.php?u=' + encodeURIComponent(location.href);
        Share.popup(url);
    },
    twitter: function (purl, ptitle, pimg, text) {
        url = 'http://twitter.com/share?';
        url += 'text=' + encodeURIComponent(ptitle);
        url += '&url=' + encodeURIComponent(purl);
        url += '&counturl=' + encodeURIComponent(purl);
        Share.popup(url);
    },
    google: function (purl, ptitle, pimg, text) {
        url = 'https://plus.google.com/share?';
        url += 'url=' + encodeURIComponent(purl);
        url += '&title=' + encodeURIComponent(ptitle);
        url += '&description=' + encodeURIComponent(text);
        url += '&imageurl=' + encodeURIComponent(pimg);
        Share.popup(url)
    },
    livejornal: function (purl, ptitle, pimg, text) {
        url = 'http://www.livejournal.com/update.bml?';
        url += 'subject=' + encodeURIComponent(purl) + encodeURIComponent(ptitle);
        url += '&event=' + encodeURIComponent(text);
        Share.popup(url)
    },

    popup: function (url) {
        window.open(url, '', 'toolbar=0,status=0,width=626,height=436');
    }
};

(function () {
    jQuery('#spterm').on('input', function () {
        if (jQuery('#spterm').val() != term) {
            var term = jQuery('#spterm').val();
            //console.log(term);
            if (/^[--]*$/i.test(term)) {
                //console.log("yes");
                jQuery(document).ready(function () {
                    var minlen = 1; //   
                    var paddingtop = 30; //    
                    var scrollspeed = 200; //  
                    var keyint = 500; //    
                    var term = '';
                    var n = 0;
                    var time_keyup = 0;
                    var time_search = 0;

                    function dosearch() {
                        term = jQuery('#spterm').val();
                        jQuery('span.highlight').each(function () { //  
                            jQuery(this).after(jQuery(this).html()).remove();
                        });
                        jQuery('div#content').find(jQuery('p')).each(function () { // 
                            jQuery(this).removeClass('word-none');
                        });
                        jQuery('div#content').find(jQuery('li')).each(function () { // 
                            jQuery(this).removeClass('word-none');
                        });
                        var t = '';
                        jQuery('div#content').each(function () { //     
                            jQuery(this).html(jQuery(this).html().replace(new RegExp(term, 'ig'), '<span class="highlight">$&</span>')); //   
                            jQuery(this).find(jQuery('p:not(:has(span))')).addClass('word-none');
                            jQuery(this).find(jQuery('li:not(:has(p span))')).addClass('word-none');
                            n = jQuery('span.highlight').length; //   
                            //console.log('n = '+n);
                            if (n == 0)
                                jQuery('#spresult').html('  ');
                        });
                    }

                    jQuery('#spterm').keyup(function () {
                        var d1 = new Date();
                        time_keyup = d1.getTime();
                        if (jQuery('#spterm').val() != term) // ,   
                            if (jQuery('#spterm').val().length >= minlen) { //   
                                setTimeout(function () { //   
                                    var d2 = new Date();
                                    time_search = d2.getTime();
                                    if (time_search - time_keyup >= keyint) //    
                                        dosearch(); //    ,   
                                }, keyint);
                            }
                            else {
                                jQuery('#spresult').html('&nbsp'); //   ,    DIV  

                                jQuery('span.highlight').each(function () { //  
                                    jQuery(this).after(jQuery(this).html()).remove();
                                });
                                jQuery('div#content').find(jQuery('p')).each(function () { // 
                                    jQuery(this).removeClass('word-none');
                                });
                                jQuery('div#content').find(jQuery('li')).each(function () { // 
                                    jQuery(this).removeClass('word-none');
                                });
                            }
                    });
                });

            }
            else {
                //console.log("NO");
                jQuery('#spterm').val('');
            }
        }
    });
})();

